(21, 'MAPS', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d1566.5168648329168!2d105.76783695771385!3d20.959501524981498!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x313452dadf0cb857%3A0x72ca61eafd9decf4!2zQ0hVTkcgQ8avIFbEgk4gUEjDmiBWSUNUT1JJQSBIw4AgxJDDlE5H!5e0!3m2!1svi!2s!4v1461555992699" width="100%" height="450" frameborder="0" style="border:0" allowfullscreen></iframe>', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d1566.5168648329168!2d105.76783695771385!3d20.959501524981498!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x313452dadf0cb857%3A0x72ca61eafd9decf4!2zQ0hVTkcgQ8avIFbEgk4gUEjDmiBWSUNUT1JJQSBIw4AgxJDDlE5H!5e0!3m2!1svi!2s!4v1461555992699" width="100%" height="450" frameborder="0" style="border:0" allowfullscreen></iframe>', '', 1, 'TEXTAREA', 8, 'Bản đồ', 1, NULL),
(22, 'DIACHI', '<h3>Địa chỉ li&ecirc;n hệ</h3>\n<p>VPGD: 130 Ho&agrave;ng S&acirc;m, Cầu Giấy, H&agrave; Nội</p>\n<p><a href="tel:0439955060">Tel: 0439955060</a></p>\n<p>Fax: 0439955060</p>\n<p><a href="mailto:emaroil@gmail.com">Email: emaroil@gmail.com</a></p>', '<h3>Địa chỉ li&ecirc;n hệ</h3>\n<p>VPGD: 130 Ho&agrave;ng S&acirc;m, Cầu Giấy, H&agrave; Nội</p>\n<p><a href="tel:0439955060">Tel: 0439955060</a></p>\n<p>Fax: 0439955060</p>\n<p><a href="mailto:emaroil@gmail.com">Email: emaroil@gmail.com</a></p>', '', 1, 'EDITOR', 8, 'Địa chỉ', NULL, NULL),
(23, 'CONTENT_HOME', '', '<p>Tổng C&ocirc;ng ty CP Phong Ph&uacute; trải qua 50 năm h&igrave;nh th&agrave;nh v&agrave; ph&aacute;t triển. Suốt chặng đường d&agrave;i ấy Phong Ph&uacute; kh&ocirc;ng ngừng lớn mạnh về mọi mặt. Tổng C&ocirc;ng ty vinh dự được Đảng v&agrave; Nh&agrave; nước trao tặng danh hiệu Anh h&ugrave;ng lao động v&agrave; l&agrave; doanh nghiệp ho&agrave;n thiện chuỗi sản xuất kh&eacute;p k&iacute;n h&agrave;ng đầu Tập đo&agrave;n Dệt May Việt Nam. Tiền th&acirc;n của Tổng c&ocirc;ng ty CP Phong Ph&uacute; l&agrave; Khu Kỹ nghệ Sicovina - Phong Ph&uacute; trực thuộc C&ocirc;ng ty kỹ nghệ B&ocirc;ng vải Việt Nam. Nh&agrave; m&aacute;y đặt vi&ecirc;n đ&aacute; đầu ti&ecirc;n x&acirc;y dựng v&agrave;o ng&agrave;y 14/10/1964, đến năm 1966 ch&iacute;nh thức đi v&agrave;o hoạt động, do ch&iacute;nh quyền S&agrave;i G&ograve;n cũ trực tiếp quản l&yacute;.</p>\n<div class="col-sm-12 anhtt"><br />\n<p class="textc">Vi&ecirc;n đ&aacute; đầu ti&ecirc;n</p>\n</div>\n<p>Tại thời điểm đ&oacute;, Sicovina - Phong Ph&uacute; l&agrave; một nh&agrave; m&aacute;y c&oacute; quy m&ocirc; nhỏ với 3 xưởng sản xuất: Sợi - Dệt - Nhuộm, tổng số CB.CNV hơn 1.050 người. Sản phẩm chủ yếu l&agrave; sợi v&agrave; một số mặt h&agrave;ng vải như Satin, Batist, Cr&egrave;stone, Khaki, vải xi&ecirc;m, vải &uacute; đen&hellip; chủ yếu để cung cấp cho qu&acirc;n đội v&agrave; một &iacute;t b&aacute;n về c&aacute;c v&ugrave;ng n&ocirc;ng th&ocirc;n. Nh&agrave; m&aacute;y ban đầu với 40.000m2 cơ xưởng tr&ecirc;n một thửa đất rộng 17 mẫu tại l&agrave;ng Tăng Nhơn Ph&uacute; thuộc quận Thủ Đức b&ecirc;n cạnh Xa Lộ - nay l&agrave; Phường Tăng Nhơn Ph&uacute; B, quận 9, TP. Hồ Ch&iacute; Minh. Sau giải ph&oacute;ng (30/04/1975), nh&agrave; m&aacute;y được đổi t&ecirc;n th&agrave;nh Nh&agrave; m&aacute;y Dệt Phong Ph&uacute;. Nh&agrave; nước giao cho CB.CNV nh&agrave; m&aacute;y tiếp quản v&agrave; duy tr&igrave; sản xuất. Trong những năm 1980, sản phẩm của nh&agrave; m&aacute;y chủ yếu l&agrave; vải bảo hộ lao động v&agrave; calicot giao cho Li&ecirc;n X&ocirc; theo kế hoạch của Nh&agrave; nước. Sau đ&oacute; nh&agrave; m&aacute;y sản xuất vải jeans, sợi polyester, sợi Peco. Suốt chặng đường từ 1976 - 1985, Nh&agrave; m&aacute;y Dệt Phong Ph&uacute; l&agrave; một trong những đơn vị li&ecirc;n tục ho&agrave;n th&agrave;nh v&agrave; ho&agrave;n th&agrave;nh vượt mức c&aacute;c chỉ ti&ecirc;u kế hoạch Nh&agrave; nước giao, b&igrave;nh qu&acirc;n mỗi năm vượt mức kế hoạch từ 10 - 15%..</p>\n<div class="col-sm-12 anhtt">&nbsp;</div>\n<p>Từ năm 1986 đến năm 2002 thực hiện ch&iacute;nh s&aacute;ch đổi mới của Đảng v&agrave; Nh&agrave; nước, CB.CNV Phong Ph&uacute; đ&atilde; chung sức, chung l&ograve;ng đưa c&ocirc;ng ty từng bước ph&aacute;t triển đi l&ecirc;n vững chắc, lu&ocirc;n l&agrave; đơn vị dẫn đầu ng&agrave;nh dệt may Việt Nam. Sản phẩm trong giai đoạn n&agrave;y ngo&agrave;i vải, sợi, Phong Ph&uacute; ph&aacute;t triển mặt h&agrave;ng khăn l&ocirc;ng, vải kat&eacute; sọc, vải jeans, li&ecirc;n doanh với Tập đo&agrave;n Coats của Vương quốc Anh sản xuất chỉ may. Từ năm 2003 đến nay, Phong Ph&uacute; đ&atilde; c&oacute; những bước ph&aacute;t triển vượt bậc về mọi mặt - doanh thu, tốc độ tăng trưởng, lợi nhuận, nộp ng&acirc;n s&aacute;ch, chăm lo đời sống vật chất tinh thần CB.CNV&hellip; Lấy dệt may l&agrave; lĩnh vực cốt l&otilde;i, Phong Ph&uacute; từng bước đa dạng h&oacute;a ng&agrave;nh nghề sản xuất kinh doanh, mở rộng li&ecirc;n doanh, li&ecirc;n kết với c&aacute;c đơn vị trong v&agrave; ngo&agrave;i ng&agrave;nh dệt may tr&ecirc;n khắp cả nước. Phong Ph&uacute; với nhiều h&igrave;nh thức sở hữu về nguồn vốn, đa dạng về ng&agrave;nh nghề sản xuất kinh doanh, li&ecirc;n doanh với nhiều tỉnh th&agrave;nh trong nước v&agrave; quốc tế. Đầu năm 2006, được sự chấp thuận của l&atilde;nh đạo Tập đo&agrave;n Dệt May Việt Nam v&agrave; Bộ C&ocirc;ng nghiệp (nay l&agrave; Bộ C&ocirc;ng thương), Phong Ph&uacute; đ&atilde; mạnh dạn x&acirc;y dựng đề &aacute;n chuyển đổi cơ cấu tổ chức th&agrave;nh Tổng c&ocirc;ng ty hoạt động theo m&ocirc; h&igrave;nh C&ocirc;ng ty mẹ - C&ocirc;ng ty con. Căn cứ y&ecirc;u cầu ph&aacute;t triển, quy m&ocirc; v&agrave; t&igrave;nh h&igrave;nh thực tế hoạt động của Phong Ph&uacute;, Thủ tướng ch&iacute;nh phủ đ&atilde; ph&ecirc; duyệt v&agrave; cho triển khai thực hiện đề &aacute;n chuyển đổi cơ cấu tổ chức th&agrave;nh Tổng c&ocirc;ng ty. Ng&agrave;y 11/01/2007 Bộ trưởng Bộ C&ocirc;ng nghiệp đ&atilde; ra quyết định số 06/2007/QĐ-BCN th&agrave;nh lập Tổng C&ocirc;ng ty Phong Ph&uacute;. Việc cải tiến chuyển đổi cơ cấu tổ chức quản l&yacute; Tổng C&ocirc;ng ty hoạt động theo m&ocirc; h&igrave;nh C&ocirc;ng ty mẹ - C&ocirc;ng ty con tạo n&ecirc;n sự li&ecirc;n kết bền chặt, x&aacute;c định r&otilde; quyền lợi, tr&aacute;ch nhiệm về vốn v&agrave; lợi &iacute;ch kinh tế giữa c&ocirc;ng ty mẹ Phong Ph&uacute; với c&aacute;c c&ocirc;ng ty con. Qua đ&oacute;, tăng cường năng lực sản xuất, tiếp thị, cung ứng, nghi&ecirc;n cứu, đ&agrave;o tạo&hellip; tạo điều kiện để Phong Ph&uacute; ph&aacute;t triển th&agrave;nh đơn vị kinh tế mạnh đủ sức cạnh tranh v&agrave; hội nhập với nền kinh tế trong khu vực v&agrave; thế giới.</p>', '', 0, 'EDITOR', 9, 'Bài viết giới thiệu trang chủ', NULL, NULL),
