(27, 'nhan-vien-hanh-chinh', 1, 'A001', '<p><strong><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">VỊ TR&Iacute; TUYỂN DỤNG</span></strong></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Nh&acirc;n vi&ecirc;n H&agrave;nh ch&iacute;nh - Thủ tục</span></p>\n<p><strong><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">ĐỊA ĐIỂM L&Agrave;M VIỆC</span></strong></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">H&agrave; Nội</span></p>\n<p><strong><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">SỐ LƯỢNG CẦN TUYỂN</span></strong></p>\n<ul>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">01</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Giới t&iacute;nh: Nữ</span></li>\n</ul>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">&nbsp;</span></p>\n<p><strong><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">M&Ocirc; TẢ &amp; Y&Ecirc;U CẦU&nbsp;C&Ocirc;NG VIỆC</span></strong></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">- Y&ecirc;u cầu chung:</span></p>\n<ul>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Quản trị lao động tiền lương.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Thực hiện c&aacute;c c&ocirc;ng việc li&ecirc;n quan tới tổ chức sự kiện của c&ocirc;ng ty v&agrave; chăm s&oacute;c đời sống tinh thần của c&aacute;n bộ c&ocirc;ng nh&acirc;n vi&ecirc;n c&ocirc;ng ty (như: Tổ chức lễ sinh nhật, Tổng Kết, Nghỉ m&aacute;t&hellip;).</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Thực hiện c&aacute;c c&ocirc;ng việc theo ph&acirc;n c&ocirc;ng chỉ đạo của Trưởng Ph&ograve;ng H&agrave;nh Ch&iacute;nh Nh&acirc;n Sự.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">L&agrave;m c&aacute;c thủ tục cho kh&aacute;ch h&agrave;ng</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Photo giấy tờ của kh&aacute;ch h&agrave;ng v&agrave; lập sổ b&agrave;n giao hồ sơ cho kh&aacute;ch h&agrave;ng.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Chăm s&oacute;c kh&aacute;ch h&agrave;ng: Gọi điện, gửi thư th&ocirc;ng b&aacute;o cho kh&aacute;ch h&agrave;ng, tiếp nhận c&aacute;c phản ảnh của kh&aacute;ch h&agrave;ng, b&aacute;o c&aacute;o v&agrave; đề xuất phương &aacute;n xử l&yacute;.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Kh&ocirc;ng n&oacute;i ngọng, n&oacute;i lắp.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Ngoại h&igrave;nh ưa nh&igrave;n.</span></li>\n</ul>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Mức lương:&nbsp;thỏa thuận</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> - Thời gian l&agrave;m việc: theo giờ h&agrave;nh ch&iacute;nh</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> - Thời gian thử việc: 2 th&aacute;ng</span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">&nbsp;</span></p>\n<p><strong><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">QUYỀN LỢI&nbsp;</span></strong><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> - Ứng vi&ecirc;n trúng tuy&ecirc;̉n được hòa nh&acirc;̣p vào m&ocirc;i trường làm vi&ecirc;̣c chuy&ecirc;n nghiệp, cơ hội thăng tiến cao.</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> B&ecirc;n cạnh đó, C&ocirc;ng ty&nbsp;đảm bảo ch&ecirc;́ đ&ocirc;̣ ti&ecirc;̀n lương và đãi ng&ocirc;̣ thỏa đáng, ph&ugrave; hợp với quy định của c&ocirc;ng ty.</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> - Nghỉ m&aacute;t,&nbsp;chế độ nghỉ ph&eacute;p, bảo hiểm x&atilde; hội, bảo hiểm y tế, bảo hiểm th&acirc;n thể, thưởng th&aacute;ng 13, thưởng nh&acirc;n vi&ecirc;n xuất sắc....theo đ&uacute;ng quy định của nh&agrave; nước v&agrave; c&ocirc;ng ty.</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> &nbsp;</span></p>\n<p><strong><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">HẠN NỘP HỒ SƠ: 30/04/2016</span></strong><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> Ứng vi&ecirc;n quan t&acirc;m, vui l&ograve;ng gửi hồ sơ tới địa chỉ email:&nbsp;thuy.lt@ppdt.com.vn&nbsp;(tối đa 10MB) hoặc nộp hồ sơ trực tiếp tại Ph&ograve;ng giao dịch của c&ocirc;ng ty tại: Tầng 3, số 2 L&ecirc; Th&aacute;nh T&ocirc;ng, Ho&agrave;n Kiếm, H&agrave; Nội. Hồ sơ bao gồm&nbsp;c&aacute;c t&agrave;i liệu sau:</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> - Đơn xin việc</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> - Sơ yếu l&yacute; lịch</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> - CV bằng&nbsp;tiếng Việt</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> - Bản chụp hoặc scan:</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> + Ảnh 4x6</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> + Hộ khẩu, chứng minh nh&acirc;n d&acirc;n.</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> + Giấy kh&aacute;m sức khỏe tại bệnh viện tuyến huyện trở l&ecirc;n.</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> + C&aacute;c bằng cấp, bảng điểm c&oacute; li&ecirc;n quan.</span></p>', 'Nhân viên hành chính - thủ tục', 'Hành chính - Thủ tục', 1, 'Hà Nội', 'A001', 'Administrative staff', '', '01', 'Hanoi', ''),
(28, 'nhan-vien-marketing', 1, 'M001', '<p><strong><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">VỊ TR&Iacute; TUYỂN DỤNG</span></strong></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Nh&acirc;n vi&ecirc;n Marketing</span></p>\n<p><strong><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">ĐỊA ĐIỂM L&Agrave;M VIỆC</span></strong></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">H&agrave; Nội</span></p>\n<p><strong><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">SỐ LƯỢNG CẦN TUYỂN</span></strong></p>\n<ul>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">01</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Giới t&iacute;nh: Nam/Nữ</span></li>\n</ul>\n<p><strong><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">&nbsp;</span></strong></p>\n<p><strong><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">M&Ocirc; TẢ &amp; Y&Ecirc;U CẦU&nbsp;C&Ocirc;NG VIỆC</span></strong></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">- Y&ecirc;u cầu chung:</span></p>\n<ul>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Kinh nghi&ecirc;m l&agrave;m việc: Tối thiểu 2 năm l&agrave;m Marketing, trong đ&oacute; tối thiểu 1 năm l&agrave;m Marketing trong lĩnh vực BĐS.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">C&oacute; kỹ năng viết b&agrave;i PR.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Lập kế hoạch v&agrave; tổ chức triển khai thực hiện c&aacute;c hoạt động Marketing theo chỉ đạo v&agrave; ph&acirc;n c&ocirc;ng của trưởng ph&ograve;ng marketing</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">C&ugrave;ng với ph&ograve;ng đề xuất v&agrave; triển khai thực hiện ( sau khi được l&atilde;nh đạo c&ocirc;ng ty ph&ecirc; duyệt c&aacute;c đề xuất đ&oacute;) c&aacute;c chương tr&igrave;nh, ch&iacute;nh s&aacute;ch hỗ trợ cho c&ocirc;ng t&aacute;c b&aacute;n h&agrave;ng của c&ocirc;ng ty đạt hiệu quả.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">C&ugrave;ng với ph&ograve;ng thực hiện c&aacute;c c&ocirc;ng việc li&ecirc;n quan đến việc quảng b&aacute; thương hiệu, nhận diện thương hiệu, khuếch trương thương hiệu ra ngo&agrave;i thị trường ng&agrave;y c&agrave;ng lớn mạnh, ng&agrave;y c&agrave;ng nhiều người biết đến hơn nữa.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">C&ugrave;ng với ph&ograve;ng triển khai đăng k&yacute; tham dự c&aacute;c giải thưởng h&agrave;ng năm của Việt Nam như: thương hiệu mạnh&hellip;( nếu được ban l&atilde;nh đạo c&ocirc;ng ty ph&ecirc; duyệt tham dự), tham dự c&aacute;c hội chợ triển l&atilde;m d&agrave;nh cho bất động sản ..( nếu được ban l&atilde;nh đạo c&ocirc;ng ty ph&ecirc; duyệt).</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Kiểm so&aacute;t nội dung dự &aacute;n tr&ecirc;n Website c&ocirc;ng ty, chỉnh sửa bố cục, viết b&agrave;i đăng tr&ecirc;n website c&ocirc;ng ty nhằm thu h&uacute;t người đọc.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Triển khai v&agrave; kiểm so&aacute;t th&ocirc;ng tin tr&ecirc;n Mạng x&atilde; hội; fanpage; Kiểm so&aacute;t th&ocirc;ng tin của Đại l&yacute; tr&ecirc;n hệ thống mạng x&atilde; hội v&agrave; website (digital)</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">T&igrave;m kiếm, đ&agrave;m ph&aacute;n, theo d&otilde;i hợp đồng v&agrave; thực hiện thanh quyết to&aacute;n với c&aacute;c nh&agrave; cung cấp dịch vụ marketing, quảng c&aacute;o, thiết kế &hellip;</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Thiết kế c&aacute;c ấn phẩm, t&agrave;i liệu Marketing theo chỉ đạo của L&atilde;nh đạo ph&ograve;ng, đảm bảo c&aacute;c sản phẩm Marketing được sản xuất đ&uacute;ng, hấp dẫn, đ&uacute;ng thời hạn.</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Kh&ocirc;ng n&oacute;i lắp, n&oacute;i ngọng.&nbsp;</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Ngoại h&igrave;nh ưa nh&igrave;n</span></li>\n<li><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Thực hiện c&aacute;c c&ocirc;ng việc kh&aacute;c theo chỉ đạo của l&atilde;nh đạo ph&ograve;ng</span></li>\n</ul>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">Mức lương:&nbsp;thỏa thuận</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> - Thời gian l&agrave;m việc: theo giờ h&agrave;nh ch&iacute;nh</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> - Thời gian thử việc: 2 th&aacute;ng</span></p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">&nbsp;</span></p>\n<p><strong><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">QUYỀN LỢI&nbsp;</span></strong><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> - Ứng vi&ecirc;n trúng tuy&ecirc;̉n được hòa nh&acirc;̣p vào m&ocirc;i trường làm vi&ecirc;̣c chuy&ecirc;n nghiệp, cơ hội thăng tiến cao.</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> B&ecirc;n cạnh đó, C&ocirc;ng ty&nbsp;đảm bảo ch&ecirc;́ đ&ocirc;̣ ti&ecirc;̀n lương và đãi ng&ocirc;̣ thỏa đáng, ph&ugrave; hợp với quy định của c&ocirc;ng ty.</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> - Nghỉ m&aacute;t,&nbsp;chế độ nghỉ ph&eacute;p, bảo hiểm x&atilde; hội, bảo hiểm y tế, bảo hiểm th&acirc;n thể, thưởng th&aacute;ng 13, thưởng nh&acirc;n vi&ecirc;n xuất sắc....theo đ&uacute;ng quy định của nh&agrave; nước v&agrave; c&ocirc;ng ty.</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> &nbsp;</span></p>\n<p><strong><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">HẠN NỘP HỒ SƠ: 30/04/2016</span></strong><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> Ứng vi&ecirc;n quan t&acirc;m, vui l&ograve;ng gửi hồ sơ tới địa chỉ email:&nbsp;thuy.lt@ppdt.com.vn&nbsp;(tối đa 10MB) hoặc nộp hồ sơ trực tiếp tại Ph&ograve;ng giao dịch của c&ocirc;ng ty tại: Tầng 3, số 2 L&ecirc; Th&aacute;nh T&ocirc;ng, Ho&agrave;n Kiếm, H&agrave; Nội. Hồ sơ bao gồm&nbsp;c&aacute;c t&agrave;i liệu sau:</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> - Đơn xin việc</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> - Sơ yếu l&yacute; lịch</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> - CV bằng&nbsp;tiếng Việt</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> - Bản chụp hoặc scan:</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> + Ảnh 4x6</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> + Hộ khẩu, chứng minh nh&acirc;n d&acirc;n.</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> + Giấy kh&aacute;m sức khỏe tại bệnh viện tuyến huyện trở l&ecirc;n.</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;"> + C&aacute;c bằng cấp, bảng điểm c&oacute; li&ecirc;n quan.</span></p>\n<p>&nbsp;</p>\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: 10pt;">&nbsp;</span></p>', 'Nhân viên Marketing', 'Marketing - PR', 1, 'Hà Nội', 'M001', 'Marketer', 'Marketing - PR', '01', 'Hanoi', ''),
(29, 'nhan-vien-kinh-doanh', 1, 'B001', '<p><span style="font-family: arial, helvetica, sans-serif;"><strong><span style="color: #000000; font-size: 10pt;">VỊ TR&Iacute; TUYỂN DỤNG</span></strong></span></p>\n<p><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;">Nh&acirc;n vi&ecirc;n kinh doanh</span></p>\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong><span style="color: #000000; font-size: 10pt;">ĐỊA ĐIỂM L&Agrave;M VIỆC</span></strong></span></p>\n<p><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;">H&agrave; Nội</span></p>\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong><span style="color: #000000; font-size: 10pt;">SỐ LƯỢNG CẦN TUYỂN</span></strong></span></p>\n<ul>\n<li><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;">03</span></li>\n<li><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;">Giới t&iacute;nh: Nam/Nữ</span></li>\n</ul>\n<p><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;">&nbsp;</span></p>\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong><span style="color: #000000; font-size: 10pt;">M&Ocirc; TẢ &amp; Y&Ecirc;U CẦU&nbsp;C&Ocirc;NG VIỆC</span></strong></span></p>\n<p><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;">- Y&ecirc;u cầu chung:</span></p>\n<ul>\n<li><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;">Kinh nghiệm l&agrave;m việc: Tối thiểu 2 năm trong lĩnh vực KDBĐS, ưu ti&ecirc;n nh&acirc;n sự đ&atilde; c&oacute; kinh nghiệm l&agrave;m CĐT</span></li>\n<li><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;">Tốt nghiệp cao đẳng trở l&ecirc;n</span></li>\n<li><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;">C&oacute; kỹ năng giao tiếp, b&aacute;n h&agrave;ng BĐS</span></li>\n<li><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;">C&oacute; kỹ năng lập kế hoạch kinh doanh</span></li>\n<li><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;">C&oacute; kỹ năng chăm s&oacute;c kh&aacute;ch h&agrave;ng</span></li>\n<li><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;">C&oacute; kỹ năng marketing b&aacute;n h&agrave;ng, t&igrave;m kiếm kh&aacute;ch h&agrave;ng</span></li>\n<li><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;">Ph&aacute;t triển v&agrave; quản l&yacute; c&aacute;c k&ecirc;nh b&aacute;n h&agrave;ng tại c&aacute;c tỉnh, th&agrave;nh trong cả nước</span></li>\n<li><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;">Đảm bảo chỉ ti&ecirc;u doanh số b&aacute;n h&agrave;ng được ph&acirc;n c&ocirc;ng</span></li>\n</ul>\n<p><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;">Mức lương:&nbsp;thỏa thuận</span><br /><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;"> - Thời gian l&agrave;m việc: theo giờ h&agrave;nh ch&iacute;nh</span><br /><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;"> - Thời gian thử việc: 2 th&aacute;ng</span></p>\n<p><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;">&nbsp;</span></p>\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong><span style="color: #000000; font-size: 10pt;">QUYỀN LỢI&nbsp;</span></strong></span><br /><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;"> - Ứng vi&ecirc;n trúng tuy&ecirc;̉n được hòa nh&acirc;̣p vào m&ocirc;i trường làm vi&ecirc;̣c chuy&ecirc;n nghiệp, cơ hội thăng tiến cao.</span><br /><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;"> B&ecirc;n cạnh đó, C&ocirc;ng ty&nbsp;đảm bảo ch&ecirc;́ đ&ocirc;̣ ti&ecirc;̀n lương và đãi ng&ocirc;̣ thỏa đáng, ph&ugrave; hợp với quy định của c&ocirc;ng ty.</span><br /><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;"> - Nghỉ m&aacute;t,&nbsp;chế độ nghỉ ph&eacute;p, bảo hiểm x&atilde; hội, bảo hiểm y tế, bảo hiểm th&acirc;n thể, thưởng th&aacute;ng 13, thưởng nh&acirc;n vi&ecirc;n xuất sắc....theo đ&uacute;ng quy định của nh&agrave; nước v&agrave; c&ocirc;ng ty.</span><br /><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;"> &nbsp;</span></p>\n<p><span style="font-family: arial, helvetica, sans-serif;"><strong><span style="color: #000000; font-size: 10pt;">HẠN NỘP HỒ SƠ: 30/04/2016</span></strong></span><br /><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;"> Ứng vi&ecirc;n quan t&acirc;m, vui l&ograve;ng gửi hồ sơ tới địa chỉ email:&nbsp;thuy.lt@ppdt.com.vn&nbsp;(tối đa 10MB) hoặc nộp hồ sơ trực tiếp tại Ph&ograve;ng giao dịch của c&ocirc;ng ty tại: Tầng 3, số 2 L&ecirc; Th&aacute;nh T&ocirc;ng, Ho&agrave;n Kiếm, H&agrave; Nội. Hồ sơ bao gồm&nbsp;c&aacute;c t&agrave;i liệu sau:</span><br /><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;"> - Đơn xin việc</span><br /><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;"> - Sơ yếu l&yacute; lịch</span><br /><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;"> - CV bằng&nbsp;tiếng Việt</span><br /><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;"> - Bản chụp hoặc scan:</span><br /><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;"> + Ảnh 4x6</span><br /><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;"> + Hộ khẩu, chứng minh nh&acirc;n d&acirc;n.</span><br /><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;"> + Giấy kh&aacute;m sức khỏe tại bệnh viện tuyến huyện trở l&ecirc;n.</span><br /><span style="color: #000000; font-size: 10pt; font-family: arial, helvetica, sans-serif;"> + C&aacute;c bằng cấp, bảng điểm c&oacute; li&ecirc;n quan.</span></p>', 'Nhân viên kinh doanh', 'Kinh doanh', 2, 'Hà Nội', 'B001', 'Business man', 'Business', '2', 'Hanoi', '');
