CREATE TRIGGER `tr_in` BEFORE INSERT ON `nuy_user`
 FOR EACH ROW BEGIN
	
	declare user1 varchar(255);
	declare count int;
	DECLARE msg VARCHAR(255);
	set user1= NEW.username;

	set count = (select count(*) from nuy_user where username= user1);
	if(count>0)then 
        set msg = "Trung ten dang nhap";
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = msg;
	
    END IF;
	
END
//
DELIMITER ;
