 FOR EACH ROW BEGIN
	declare idd int;
	declare pass varchar(255);
	declare user1 varchar(255);

	declare count int;
declare count1 int;
	DECLARE msg VARCHAR(255);
	SET pass = NEW.password;
	set user1= NEW.username;
	set idd = NEW.id;
	
	
	set count = (select count(*) from nuy_user where id != idd and username = user1) ;
		if(count>0)then 
        set msg = "Trung ten dang nhap";
